import React from 'react'
import { ReactComponent as ReactLogo } from '../assets/logo.svg';
import { Button, Modal } from '@material-ui/core'
import './Header.css'
import Login from './Login/Login'


function Header() {
    return (
        <div className='header'>

            <div className='header_logo'><ReactLogo /></div>
            <Login><Button className='header_login' variant='contained' color='default' >Login</Button></Login>
            <Button color='primary' >Book Show</Button>


        </div>
    )
}

export default Header;
